import 'bootstrap/dist/css/bootstrap.min.css'
import SignUp from './components/SignUp';
import {BroswerRouter, Routes, Route } from 'react-router-dom'

function App() {
  return (
<BroswerRouter>
<Routes>
  <Route path='/register' element={<SignUp />}></Route>
</Routes>
</BroswerRouter>
  );
}

export default App;
